import Validation from "../validations/validation";
import PersonalInformationModel from "../models/porsonalinformation";
import response from "../response/response";


class PersonalInformationController {
    static createPersonalInformation (req, res){
        // fetch the data from the req.body 
        const {
            firstName,
            middleName,
            surName,
            birthDate,
            birthPlace,
            nationality,
            sex,nationalId,
            martialStatus,
            country,
             province,
             district,
             sector,
             cell,
             village,
             email,
             jobEmail,
             PrimaryNumber, 
             secondaryNumber,
             father_firstName,
             father_surName,
             mother_firstName,
             mother_surName,
             spouse_firsName,
             spouse_middleName,
             spouse_surName,
             spouseId,
             telephone,
             childrenNumber,
             dependency,
             occupation,
             insuranceType,
            bankInformation
            }=req.body;
        // check on validations
        const validationObject ={
            firstName,
            middleName,
            surName,
            birthDate,
            birthPlace,
            nationality,
            sex,nationalId,
            martialStatus,
            country,
             province,
             district,
             sector,
             cell,
             village,
             email,
             jobEmail,
             PrimaryNumber, 
             secondaryNumber,
             father_firstName,
             father_surName,
             mother_firstName,
             mother_surName,
             spouse_firsName,
             spouse_middleName,
             spouse_surName,
             spouseId,
             telephone,
             childrenNumber,
             dependency,
             occupation,
             insuranceType,
            bankInformation
            };

        const { error } = Validation.newPersonalInformationValidation(validationObject);

        if(error){
            res.status(400).json({status:400,error:`Issue made with the Input,error ${error}`});
        }else{
            // create a new peronal information using validated data;
            const createdPersonalInformation = PersonalInformationModel.createPersonalInformation(validationObject);
            res.status(201).json({
                status:201,
                data:createdPersonalInformation
            });
        }
    }
}

export default PersonalInformationController ;

